import React from "react";
import { Navbar, NavbarBrand, Container } from "react-bootstrap";

export default function Footer() {
    return (

      <div className="fixed-bottom" >
        <Navbar bg="secondary">
          <Container>
            <NavbarBrand className='m-auto text-warning' > PCDA(O) Pune & ITSDC Secunderabad</NavbarBrand>
          </Container>
        </Navbar>
      </div>
    );

}
